术追求者的需求。我们拥有一流的教师团队，他们都是各自领域的专家，充满热情，致力于激发学生的创造力和艺术才能。在我们的中心，你不仅可以学到专业的艺术技巧，还可以结识一群志同道合的朋友，共同探索艺术的奥秘。我们欢迎所有年龄段和水平的学生，期待你的加入，一同在艺术的旅途上绽放光彩。','明天艺术培训中心','https://learn-platform-assets.oss-cn-hangzhou.aliyuncs.com/images/rc-upload-1685950480847-8.JPG','北京亮马桥中心','120.11','39.91405','19828738899'),('e0849bc0-c0fd-4c2c-b42e-1153fcdf614a','2023-02-05 17:16:08','5e57615b-0a02-4a4f-b1b0-085c6eebb5f8','2023-02-05 17:16:08',NULL,NULL,NULL,'http://learn-platform-assets.oss-cn-hangzhou.aliyuncs.com/images/1674744944585.jpg','http://learn-platform-assets.oss-cn-hangzhou.aliyuncs.com/images/1674744944585.jpg','http://learn-platform-assets.oss-cn-hangzhou.aliyuncs.com/images/1674744944585.jpg',NULL,'','慕课123','http://learn-platform-assets.oss-cn-hangzhou.aliyuncs.com/images/1674744944585.jpg',NULL,NULL,NULL,'18777777777'),('ef7aeb52-eeb3-46e8-bfeb-ce27f58b9768','2023-02-06 16:00:37','5e57615b-0a02-4a4f-b1b0-085c6eebb5f8','2023-03-27 14:15:47','5e57615b-0a02-4a4f-b1b0-085c6eebb5f8',NULL,NULL,'http://learn-platform-assets.oss-cn-hangzhou.aliyuncs.com/images/rc-upload-1675698951529-10.png','http://learn-platform-assets.oss-cn-hangzhou.aliyuncs.com/images/rc-upload-1675698951529-12.png','http://learn-platform-assets.oss-cn-hangzhou.aliyuncs.com/images/rc-upload-1675698951529-14.png','免费 WIFI','北京朝阳区九张街道2002','旧厂街店','http://learn-platform-assets.oss-cn-hangzhou.aliyuncs.com/images/rc-upload-1675698951529-8.jpg','北京朝阳区九张街道2002','120.11','120.33','18777777777'),('f2327636-5804-46cd-bfcd-d184eed2e549','2023-02-06 16:00:38','5e57615b-0a02-4a4f-b1b0-085c6eebb5f8','2023-02-06 16:00:38',NULL,'2023-02-12 23:11:13.000000','5e57615b-0a02-4a4f-b1b0-085c6eebb5f8','http://learn-platform-assets.oss-cn-hangzhou.aliyuncs.com/images/rc-upload-1675698951529-10.png','http://learn-platform-assets.oss-cn-hangzhou.aliyuncs.com/images/rc-upload-1675698951529-12.png','http://learn-platform-assets.oss-cn-hangzhou.aliyuncs.com/images/rc-upload-1675698951529-14.png','免费 WIFI','北京朝阳区九张街道2002','慕课123','http://learn